《战舰少女：精神污染》(Warship Girls: Embarrassing Duty)是一款来自贴吧民间的战舰少女恶搞向同人RPG游戏，原名《战舰少女同人恶搞向RPG游戏》。作者为[http://weibo.com/u/5070189755 战舰少女RPG制作-神_韵_酱]。

== 简介 ==

《精神污染》是一款战舰少女恶搞向的同人RPG，在游戏中玩家们扮演一位名不见经传的{{黑幕|凶悍的}}小提督{{黑幕|韭菜}}在整张大地图上到处收集舰娘{{黑幕|后宫}}。因为没有制作战斗系统，更类似于文字游戏。在[http://weibo.com/u/5070189755 微博]和[http://tieba.baidu.com/p/4002777291 贴吧]发布。

作者以“驱逐潜艇重炮补给→轻巡重巡→战列战巡航母轻母→改造版”的顺序正在紧张的制作{{黑幕|玩梗}}中，目前航母战列版本已经放出。

因为制作马马虎虎，梗玩的丧心病狂，该同人游戏得到了大多数提督{{黑幕|扔来的石头}}。

